import React from "react";
import { NavLink } from "react-router-dom";
import style from "./AuthNav.module.css";
export default function AuthNav() {
  return (
    <div>
      <NavLink
        to="/register"
        exact
        style={style.link}
        activeStyle={style.activeLink}
      >
        Регистрация
      </NavLink>
      <NavLink
        to="/login"
        exact
        style={style.link}
        activeStyle={style.activeLink}
      >
        Логин
      </NavLink>
    </div>
  );
}
